import React from "react";
import hello from "./hello.png";

function Signup() {
  return (
    <div className="flex flex-col items-center justify-center h-screen">
      <h1>Signup</h1>
      <img src={hello} alt="hello" />
    </div>
  );
}

export default Signup;
